import React, { useState, useEffect } from 'react';
import axios from 'axios';

const DisplayResume = () => {
  const [filesMetadata, setFilesMetadata] = useState([]);

  useEffect(() => {
    const fetchFilesMetadata = async () => {
      try {
        const response = await axios.get(
          'https://functionappuserresumes.azurewebsites.net/api/HttpTriggerGetResume?code=3xBINMjx9M_ybw4gII-HTDCL5ejk46kuzkfwebsa1gMpAzFu5xSR0w=='
        );
        setFilesMetadata(response.data);
      } catch (error) {
        console.error('Error fetching files metadata:', error.message);
      }
    };

    fetchFilesMetadata();
  }, []);

  const renderFile = (file) => {
    switch (file.fileType) {
      case 'pdf':
        return (
          <object data={file.blobUrl} type="application/pdf" width="100%" height="500px">
            <p>PDF cannot be displayed.</p>
          </object>
        );

      case 'video':
        return (
          <video width="100%" height="500px" controls>
            <source src={file.blobUrl} type="video/mp4" />
            Your browser does not support the video tag.
          </video>
        );

      case 'audio':
        return (
          <audio controls>
            <source src={file.blobUrl} type="audio/mp3" />
            Your browser does not support the audio element.
          </audio>
        );

      default:
        return null;
    }
  };

  return (
    <div>
      <h1>Display Resumes</h1>
      <ul>
        {filesMetadata.map((file) => (
          <li key={file.mediaID}>
            <strong>User ID:</strong> {file.userId}, <strong>Media ID:</strong> {file.mediaID},{' '}
            <strong>File Type:</strong> {file.fileType}, <strong>Timestamp:</strong> {file.timestamp}
            <div>{renderFile(file)}</div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default DisplayResume;
